import Components from "./src/screens/ComponentsScreen";

const navigator = createStackNavigator(
  {
    Home: HomeScreen,
    Components: Compon
  },
  {
    initialRouteName: "Home",
    defaultNavigationOptions: {
      title: "Arda KAPTAN Pill Reminder"
